(2, 'filmy', '<div class=\"banner\">\r\n    <img src=\"images/zol3.jpg\" alt=\"\" style=\"transform: translateY(-400px);\">\r\n    <h1>FIlmy</h1>\r\n</div>\r\n\r\n<div class=\"container\">\r\n    <article class=\"container\">\r\n        <h1>Co powinniśmy wiedzieć przed zakupem żółwia?</h1>\r\n        <iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/RlPOGEXQ3Sk?si=P_7kzED1-biWEXH6\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" referrerpolicy=\"strict-origin-when-cross-origin\" allowfullscreen></iframe>\r\n    </article>\r\n    \r\n    <article class=\"container\">\r\n        <h1>Ciekawostki o hodowli żółwia w domu</h1>\r\n        <iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/vXgUtu3Rxyw?si=87L_juBojJeCZ8Va\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" referrerpolicy=\"strict-origin-when-cross-origin\" allowfullscreen></iframe>\r\n    </article>\r\n\r\n    <article class=\"container\">\r\n        <h1>Jak zrobić terrarium dla żółwia lądowego?</h1>\r\n        <iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/_tq00jXIX2Y?si=GzKL0wprt-cF-OFF\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" referrerpolicy=\"strict-origin-when-cross-origin\" allowfullscreen></iframe>\r\n    </article>\r\n</div>', 1),
(3, 'akcesoria', '<div class=\"banner\">\r\n    <img src=\"images/zol5.jpg\" alt=\"\" style=\"transform: translateY(-200px);\">\r\n    <h1>Akcesoria</h1>\r\n</div>\r\n\r\n<div class=\"container\">\r\n    <article>\r\n        <h1>Jakie akcesoria są niezbędne dla żółwia wodnego?</h1>\r\n        <div class=\"article-image floating-left\">\r\n            <img src=\"images/zol12.jpg\" alt=\"\" style=\"width: 300px\">\r\n        </div>\r\n        <p>\r\n            Akcesoria odgrywają kluczową rolę w hodowli żółwi wodnych, zapewniając im komfort oraz bezpieczeństwo.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            <u>Podstawowym wyposażeniem</u> jest akwarium, które powinno być odpowiednio dużą przestrzenią do pływania oraz wygrzewania się.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Niezbędne są również <i>lampy UVB</i>, które dostarczają żółwiom promieniowania niezbędnego do syntezy witaminy D3.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Bez tego elementu, żółwie mogą cierpieć na choroby związane z niedoborem tej witaminy, takie jak <b>deformacje skorupy</b>.\r\n        </p>\r\n    </article>\r\n\r\n    <article>\r\n        <h1>Jakie inne akcesoria warto mieć?</h1>\r\n        <div class=\"article-image floating-right\">\r\n            <img src=\"images/zol13.jpg\" alt=\"\" style=\"width: 300px\">\r\n        </div>\r\n        <p>\r\n            Oprócz lamp UVB, warto zainwestować w <u>grzałkę</u>, która pomoże utrzymać odpowiednią temperaturę wody, oraz <i>filtr do wody</i>, aby zapewnić czystość w akwarium.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Kolejnym przydatnym akcesorium są dekoracje, takie jak kamienie, rośliny wodne oraz kryjówki, które nie tylko estetycznie wyglądają, ale także zapewniają żółwiom miejsce do odpoczynku oraz ucieczki przed ewentualnym stresem.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            <b>Warto także zaopatrzyć się w termometr</b>, aby stale monitorować temperaturę wody i powietrza w akwarium, co jest kluczowe dla zdrowia twojego żółwia.\r\n        </p>\r\n    </article>\r\n\r\n    <article>\r\n        <h1>Jak dbać o akcesoria w akwarium?</h1>\r\n        <div class=\"article-image floating-left\">\r\n            <img src=\"images/zol14.jpg\" alt=\"\" style=\"width: 300px\">\r\n        </div>\r\n        <p>\r\n            Regularne czyszczenie akcesoriów, takich jak filtry i dekoracje, jest niezbędne, aby utrzymać odpowiednie warunki w akwarium.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            <i>Filtry</i> należy wymieniać lub czyścić zgodnie z zaleceniami producenta, aby uniknąć gromadzenia się zanieczyszczeń.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Dekoracje można myć w letniej wodzie, a w razie potrzeby stosować <b>bezpieczne dla zwierząt detergenty</b>.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Zachowanie czystości akcesoriów przekłada się na zdrowie żółwia i komfort jego życia w domowym akwarium.\r\n        </p>\r\n    </article>\r\n\r\n    <article class=\"date-and-time\">\r\n        <h1>Data i Czas</h1>\r\n        <div id=\"data\"></div>\r\n        <div id=\"zegarek\"></div>\r\n    </article>\r\n</div>', 1),
(4, 'jakzaczac', '<div class=\"banner\">\r\n    <img src=\"images/zol1.jpg\" alt=\"\" style=\"transform: translateY(-400px);\">\r\n    <h1>Jak Zacząć?</h1>\r\n</div>\r\n\r\n<div class=\"container\">\r\n    <article>\r\n        <h1>Jak przygotować akwarium dla żółwia wodnego?</h1>\r\n        <div class=\"article-image floating-right\">\r\n            <img src=\"images/zol8.jpg\" alt=\"\" style=\"width: 300px\">\r\n        </div>\r\n        <p>\r\n            Zanim przystąpisz do hodowli żółwia, <u>ważne</u> jest przygotowanie odpowiedniego akwarium.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Minimalna wielkość to <i>100 litrów</i> dla jednego dorosłego żółwia, ale im większe, tym lepiej.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Akwarium musi zawierać <b><i>czystą wodę</i></b> do pływania oraz <u>wyspę lądową</u>, na której żółw będzie mógł się wygrzewać.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Woda powinna mieć temperaturę <i>24-28°C</i>, natomiast miejsce do wygrzewania się powinno mieć <u>około 30-35°C</u>.\r\n        </p>\r\n    </article>\r\n\r\n    <article>\r\n        <h1>Jakie wyposażenie jest niezbędne dla żółwia wodnego?</h1>\r\n        <p>\r\n            Do hodowli żółwia wodnego potrzebujesz kilku podstawowych elementów:\r\n        </p>\r\n        <ul>\r\n            <li><b>Lampy UVB</b> wspomagają produkcję witaminy D3, kluczowej dla <i>zdrowia skorupy</i>.</li>\r\n            <li><u>Filtracja wody</u> jest niezbędna do usuwania toksyn, które gromadzą się w wodzie.</li>\r\n            <li>Dobrze dobrany filtr nie tylko <b>zapewnia czystość</b> wody, ale również pomaga utrzymać żółwia w zdrowiu.</li>\r\n            <li><i>Grzałka</i> i termometr pozwolą ci kontrolować temperaturę, zapewniając optymalne warunki do życia.</li>\r\n        </ul>\r\n    </article>\r\n    \r\n    <article class=\"date-and-time\">\r\n        <h1>Data i Czas</h1>\r\n        <div id=\"data\"></div>\r\n        <div id=\"zegarek\"></div>\r\n    </article>\r\n</div>', 1),
(5, 'wskazowki', '<div class=\"banner\">\r\n    <img src=\"images/zol4.webp\" alt=\"\" style=\"transform: translateY(-200px);\">\r\n    <h1>Wskazówki</h1>\r\n</div>\r\n\r\n<div class=\"container\">\r\n    <article>\r\n        <h1>Jak dbać o zdrowie żółwia wodnego?</h1>\r\n        <div class=\"article-image floating-left\">\r\n            <img src=\"images/zol11.jpg\" alt=\"\" style=\"width: 300px\">\r\n        </div>\r\n        <p>\r\n            Zdrowie żółwia wodnego w dużej mierze zależy od <u>prawidłowej diety</u> oraz regularnej opieki.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Żółwie są wszystkożerne, dlatego ich dieta powinna być zróżnicowana i obejmować <i>pokarmy roślinne</i> (takie jak rośliny wodne, warzywa) oraz pokarmy zwierzęce (np. małe ryby, krewetki).\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Regularnie sprawdzaj, czy żółw <b>nie wykazuje objawów chorób</b>, takich jak zmiany na skorupie, miękkość skorupy czy problemy z oczami.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Pamiętaj, że zdrowa skorupa to wynik odpowiedniej diety i <i>dostępu do światła UVB</i>.\r\n        </p>\r\n    </article>\r\n\r\n    <article>\r\n        <h1>Jak utrzymać czystość w akwarium?</h1>\r\n        <p>\r\n            Aby żółw mógł cieszyć się zdrowiem, kluczowa jest <b><i>czystość wody</i></b> w akwarium.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Regularna filtracja i wymiana wody (co najmniej 25% wody co tydzień) pozwalają utrzymać odpowiednią jakość wody i zapobiegają gromadzeniu się amoniaku i innych zanieczyszczeń.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Utrzymanie poziomu <u>pH wody między 6,5 a 7,5</u> oraz stała temperatura (24-28°C) także pomagają stworzyć <i>zdrowe środowisko</i> dla twojego żółwia.\r\n        </p>\r\n    </article>\r\n\r\n    <article class=\"date-and-time\">\r\n        <h1>Data i Czas</h1>\r\n        <div id=\"data\"></div>\r\n        <div id=\"zegarek\"></div>\r\n    </article>\r\n</div>', 1),
(6, 'kontakt', '<div class=\"banner\">\r\n    <img src=\"images/zol15.jfif\" alt=\"\" style=\"transform: translateY(-400px);\">\r\n    <h1>Kontakt</h1>\r\n</div>\r\n\r\n<div class=\"contact-form\">\r\n    <h2>Chcesz się z nami skontaktować? Zostaw nam wiadmość!</h2>\r\n    <br>\r\n\r\n    <form action=\"mailto:169241@student.uwm.edu.pl\" method=\"post\">\r\n        <div class=\"contact-form-input\">\r\n            <label for=\"name\">Imie i Nazwisko<span class=\"required\">*</span></label>\r\n            <input type=\"text\" id=\"name\" name=\"name\" required>\r\n        </div>\r\n\r\n        <div class=\"contact-form-input\">\r\n            <label for=\"email\">Adres Email<span class=\"required\">*</span></label>\r\n            <input type=\"email\" id=\"email\" name=\"email\" required>\r\n        </div>\r\n        \r\n        <div class=\"contact-form-input\">\r\n            <label for=\"message\">Wiadmość<span class=\"required\">*</span></label>\r\n            <textarea id=\"message\" name=\"message\" required></textarea>\r\n        </div>\r\n\r\n        <div class=\"contact-form-input\">\r\n            <button type=\"submit\">Wyślij</button>\r\n        </div>\r\n    </form>\r\n</div>', 1),
(7, 'jedenczykilka', '<div class=\"banner\">\r\n    <img src=\"images/zol3.jpg\" alt=\"\" style=\"transform: translateY(-400px);\">\r\n    <h1>Jeden Żółw Czy Kilka?</h1>\r\n</div>\r\n\r\n<div class=\"container\">\r\n    <article>\r\n        <h1>Czy warto hodować więcej niż jednego żółwia wodnego?</h1>\r\n        <div class=\"article-image floating-right\">\r\n            <img src=\"images/zol9.jpg\" alt=\"\" style=\"width: 300px\">\r\n        </div>\r\n        <p>\r\n            Dla początkujących hodowców zaleca się trzymanie <i>jednego żółwia wodnego</i>, aby łatwiej było kontrolować warunki w akwarium oraz monitorować jego zdrowie.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Żółwie bywają terytorialne, a niektóre gatunki mogą <b>wykazywać agresję</b> wobec innych osobników.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Jeśli jednak zdecydujesz się na hodowlę więcej niż jednego żółwia, <u>upewnij się</u>, że akwarium jest odpowiednio duże, aby każdy osobnik miał swoją przestrzeń do pływania i wygrzewania.\r\n        </p>\r\n    </article>\r\n\r\n    <article>\r\n        <h1>Jakie gatunki żółwi mogą żyć razem?</h1>\r\n        <div class=\"article-image floating-right\">\r\n            <img src=\"images/zol10.jpg\" alt=\"\" style=\"width: 300px\">\r\n        </div>\r\n        <p>\r\n            Nie wszystkie gatunki żółwi dobrze współżyją w jednym akwarium.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Przykładem może być <b>żółw czerwonolicy</b>, który toleruje towarzystwo innych osobników, o ile mają dostateczną przestrzeń.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Inne gatunki, takie jak żółw błotny, mogą być bardziej terytorialne i <u>wymagać oddzielenia</u>.\r\n        </p>\r\n        <br>\r\n        <p>\r\n            Ważne jest, aby przed wprowadzeniem kolejnego żółwia dokładnie zbadać ich zachowania i skonsultować się z ekspertami, aby uniknąć <i>konfliktów</i> między osobnikami.\r\n        </p>\r\n    </article>\r\n\r\n    <article class=\"date-and-time\">\r\n        <h1>Data i Czas</h1>\r\n        <div id=\"data\"></div>\r\n        <div id=\"zegarek\"></div>\r\n    </article>\r\n</div>', 1),
